import { Component, Input } from '@angular/core';

@Component({
  selector: 'head-line',
  templateUrl: './headline.component.html',
  styleUrls: ['./headline.component.scss']
})
export class HeadlineComponent {
  @Input() 
  header: string;

  constructor() { 
    this.header = 'Missing Header';
  }

}
